import React from 'react';
import './App.css';
import TextAreaMirror from './TextAreaMirror';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>React TextArea Mirror</h1>
      </header>
      <main>
        <TextAreaMirror />
      </main>
    </div>
  );
}

export default App;
